import React from "react";
import Aside from "../../aside";
import veiculos from "../veiculos.json";

export default function CheckboxFilter({
  style,
  isVeiculoFiltrado,
  setVeiculoFiltrado,
  setVeiculos,
  automoveis,
  filtrarVeiculos,
}) {
  return (
    <div className={style.filtro}>
      {automoveis.map((marca, index) => (
        <Aside
          key={marca + index}
          isVeiculoFiltrado={isVeiculoFiltrado}
          setVeiculoFiltrado={setVeiculoFiltrado}
          marca={marca}
          filtrarVeiculos={filtrarVeiculos}
          automoveis={automoveis}
        />
      ))}
      <label>
      <input type="checkbox" onChange={()=> setVeiculos} />
      Todos
      </label>
    </div>
  );
}
